INSERT INTO `alumnus` VALUES (1000001,'CAT 99.99%ile. Converted IIM-A,B,C.',3,'I am highly indebted to the personal attention and the innovative technology based pedagogy of GP Classes. Hard pressed for time and budget, I decided to enroll in an online coaching which offered the flexibility of time along with the personalized attention of a classroom setup, GP Classes proved to be a prudent choice.',100000001),(1000002,'XAT All India Topper. Institute\'s scholar at XLRI Jamshedpur.',4,'GP Classes, unlike most institutes, caps its upper limit of class strength somewhere between the 20s-30s. Therefore, I sort of felt quite confident because I had a better opportunity of grabbing the faculty?s attention in a class of minimal strength. I got a 99.3 percentile and shall be joining IIM Bangalore. GP Classes surely is a major stakeholder of my success.',100000002),(1000003,'GRE score 345. Secured admission in Washington University. ',4,'Everyone, I believe, would have been at that place in their life were you loose faith in yourself. I thank GP sir for pulling me out of the abyss and guiding me through my preparation. I really loved the online and classroom sessions at GP Classes. GP sir takes extreme care to see that no student gets left behind in his class.',100000006),(1000004,'Converted IIM Lucknow. OPJEMS Scholar',2,'GP Sir\'s approach to teaching and the clarity of explanation is head and shoulders above the rest. Further, all of them are always approachable. The video lectures are almost as good as the class. The website and the features are amazing! Overall, this is the right place for anyone wanting to prepare CAT.',100000012),(1000005,'PGP graduate from IIM-B. Gold Medalist.',2,'Thanks to GP Classes, my DI/LR score moved from 79.46 percentile to 99.61 percentile. One of the biggest pro of attending GP Classes is the online content. It has recorded sessions of every class and every time I had a concept doubt, I just turn on my PC and watch the class.',100000020);
/*!40000 ALTER TABLE `alumnus` ENABLE KEYS */;
UNLOCK TABLES;

