INSERT INTO `contactusform` VALUES (10000001,'shaymal@gmail.com','Shyamal Sinha',9204040001,'Why are all the courses paid ones ?','We charge for our course because teachers invest significant time and energy in taking live classes and interacting with you. ',1),(10000002,'akananad45@gmail.com','Akshat Anand',9204046601,'How will the classes be conducted? What will happen if I miss a class?','You\'ll be able to attend the live classes. You can watch the recorded version of class (in case you missed the live class or you want to watch again).',1),(10000003,'rampd66@gmail.com','Ram Prasad',9205546601,'Can the question papers and answer keys of test be downloaded?','Yes. All the question papers and answer keys will be available on the website itself once the test gets over.',1),(10000004,'dnoob56@gmail.com','Mohan',9205546601,'What are the hardware requirements to take online tests?','You need to have access to a very good, continuous internet connection; mobile or laptop.',1),(10000005,'bnjha55@gmail.com','Brij Nandan Jha',9205544441,'What are the class days and timings?','Please refer to the timetable.',1),(10000006,'mkgupta66@gmail.com','Mayank Gupta',9277544441,'How will I get my doubts answered?','We\'ll be conducting special doubt classes for clearing common doubts.',1),(10000007,'vpatil7787@gmail.com','Vijay Patil',9277544433,'Do you provide any printed study material?','We do provide PDFs in the study material which you can read online or decide to print.',1),(10000008,'rahulsh67@gmail.com','Rahul Shrivastava',7277544433,'What if I don\'t like the Course?','If you have any problems with any of our products or courses please feel free to reach out to us on we will help you with it.',0);
/*!40000 ALTER TABLE `contactusform` ENABLE KEYS */;
