INSERT INTO `course` VALUES (101,5,2013,'CAT Plus','A personalised learning path that is customised for each student. The learning path adjusts itself week after week, depending on your preferences and learning speed. You are unique, so is your learning path.',1),(102,12,2016,'Comprehensive CAT','A complete learning system of live quizzes, live discussions, interactive polls, peer discussions and competitions to give you a holistic learning experience as not every learning comes from watching videos.',1),(103,12,2016,'Dream IIM ','A full fledged course which not just prepares for CAT but also trains you for Interview and Group Discussions with personal mentoring by IIM and other top B-school Grads.',1),(104,6,2017,'GREedge','Introducing GREedge, specially designed program with expert trainers, personal guidance & updated materials to help you join the league 320+ scorer club. Start preparing today & make it possible.',2),(105,6,2017,'Grade Up','Score higher on the GRE with the GRE prep course that brings you the most realistic practice for test day and more live instruction than anyone else. ',2),(106,6,2017,'XAT Turbo','With our unique LPF training methodology of Learn, Revise & Feedback, learn the concepts of XAT easier, better, and faster than ever before.',3);
