CREATE TRIGGER check_insert_panNumber BEFORE INSERT ON Employee
FOR EACH ROW
BEGIN
IF (NEW.PAN REGEXP '^[A-Z]{5}[0-9]{4}[A-Z]{1}$') = 0 THEN
  SIGNAL SQLSTATE '12345'
     SET MESSAGE_TEXT = 'Wrong PAN Number Format';
END IF;
END$$
